INSERT INTO `menuitem` VALUES (1,0,'Gebruiker',NULL,NULL,1,NULL),(2,0,'Websites',NULL,1100,2,NULL),(3,0,'FTP','/ftp',1100,3,NULL),(4,0,'Databases','/database',1100,3,NULL),(5,0,'Staff',NULL,1080,5,NULL),(7,5,'Gebruikers',NULL,1050,1,NULL),(8,5,'Websites',NULL,1050,2,NULL),(9,5,'E-mail',NULL,1050,4,NULL),(10,5,'SIN-website','/staff/page',1050,5,NULL),(11,-1,'Home','/',NULL,0,NULL),(12,1,'Start','/user/start',1100,1,NULL),(13,1,'Gegevens wijzigen','/user/edit',1100,2,NULL),(14,-1,'Inloggen','/user/login',NULL,3,NULL),(15,1,'Uitloggen','/user/logout',1100,4,NULL),(17,-1,'Registreren','/user/register',NULL,3,NULL),(18,2,'vHosts','/website/vhost',1100,1,'Een virtual host is in feite een \'virtuele website\' dat je kan toevoegen aan je bestaande account. Bij SIN krijg je dus enkele extra virtuele hosts ter beschikking waar naar je kan verwijzen met een subdomein. Een voorbeeld van een subdomein is dus je eigen account bij SIN. SIN heeft als domein: sin.khk.be. SIN geeft je als gebruiker dan een eigen subdomein, namelijk: je-gebruikers-naam.sin.khk.be.Dus als je bijvoorbeeld een forum op je SIN website hebt kan je er nu simpel naar verwijzen door: http://forum.je-gebruikers-naam.sin.khk.be.Hoe stel je nu een Virtual host in?Door te klikken op de link \'virtual hosts\'. Je krijgt nu een pagina te zien waarin je een heleboel informatie kan invullen. Je zal zien dat je al een virtual host hebt, namelijk die van SIN zelf.Voeg een vhost toeDocument root: dit is bijvoorbeeld de \'map\' waar je forum, blog, foto\'s enz in staan. Vul dit in met de juiste map naam die je hebt aangemaakt in je public_html. Bijvoorbeeld: Als je een forum hebt in forum/ moet je dan gewoon forum ingeven.Servernaam: Dit is dus de naam die je wilt toewijzen aan je nieuwe virtuele host. Dus als het over een forum gaat, kan je het ook logischerwijze forum.je-gebruikers-naam.sin.khk.be noemen.Serveradminw: Dit is dus een e-mail adres (waar iemand contact kan opnemen met je)Serveralias: Dit is geen verplicht veld. Maar je kan het wel gebruiken om meerdere namen aan ??n subdomein toe te wijzen. Bijvoorbeeld als je een forum hebt en je subdomein wijst al naar forum.je-gebruikers-naam.sin.khk.be maar je wilt NOG een naam bijvoorbeeld \'babbel\' kan je in serveralias zetten: babbel.je-gebruikers-naam.sin.khk.be.Type: Hier geef je aan welke type subdomein het gaat zijn. Standaard staat het op \'http only\' wat normaal goed zal zijn. Indien je gebruik maakt van encryptie (dus https) kan je dit ook aanduiden.CGI enabled: Als je aangemaakte subdomein gebruik maakt van cgi scripts dan kan je cgi enabled op \"yes\" zetten. Standaard staat dit op \"no\"Als alles in orde is, en als alle invulvakken (buiten serveralias) zijn ingevuld zal je dus een nieuwe virtuele host ter beschikking hebben.'),(25,43,'Algemeen','/mail',1100,1,NULL),(26,43,'Domeinen','/mail/domain',1100,2,NULL),(27,43,'E-mailadressen','/mail/user',1100,3,NULL),(28,43,'Doorstuuradressen','/mail/forwarding',1100,4,NULL),(29,7,'Gebruikers','/staff/user/user',1050,1,NULL),(30,7,'Limieten','/staff/user/limit',1050,1,NULL),(31,7,'Groepen','/staff/user/group',1050,2,NULL),(32,7,'Misbruik','/staff/user/abuse',1050,3,NULL),(33,5,'FTP','/staff/ftp',1050,3,NULL),(34,8,'vHosts','/staff/website/vhost',1050,2,NULL),(36,9,'Domeinen','/staff/mail/domain',1050,4,NULL),(37,9,'E-mailaddressen','/staff/mail/user',1050,5,NULL),(38,9,'Doorstuuradressen','/staff/mail/forwarding',1050,6,NULL),(42,-1,'Error','/error',NULL,0,NULL),(43,0,'E-mail',NULL,1100,4,NULL),(44,5,'Systeemopdrachten','/staff/systemtask',1050,6,NULL);
