INSERT INTO `page` VALUES (1,'home','Home','<h1>Welkom bij SIN!</h1>\r\n\r\n<p class=\"alert-box info\">Er lijkt wat verwarring te zijn over verlengingen. Om je account te verlengen log je in. Indien je account bijna vervalt (of reeds vervallen is) zal je de mogelijkheid krijgen deze te verlengen.<br />\r\nVerenigingen met een gratis account dienen ons een e-mail te sturen in plaats van het formulier te gebruiken.</p>\r\n\r\n<div class=\"row\">\r\n        <div class=\"large-4 medium-6 small-12 column\">\r\n                <h2>Ik heb al een account</h2>\r\n                <p>Dan kan je <a href=\"/user/login\">hier inloggen</a> om je SIN-account te beheren!</p>\r\n                <p><a href=\"/user/login\" class=\"button\">Inloggen</a>\r\n        </div>\r\n        \r\n        <div class=\"large-4 medium-6 small-12 column\">\r\n                <h2>Ik heb nog geen account</h2>\r\n                <p>Dan kan je <a href=\"/page/wat\">hier meer informatie</a> vinden! Onderaan de pagina zal je een knop vinden om je te registreren.</p>\r\n                <p><a href=\"/page/wat\" class=\"button\">Wat is SIN?</a>\r\n        </div>\r\n        \r\n        <div class=\"fb-like-box large-4 medium-12 small-12 column\" data-href=\"https://www.facebook.com/SINners.be\" data-width=\"100%\" data-height=\"100%\" data-colorscheme=\"light\" data-show-faces=\"false\" data-header=\"false\" data-stream=\"true\" data-show-border=\"false\">\r\n        </div>\r\n</div>\r\n\r\n<div id=\"fb-root\"></div>\r\n<script>(function(d, s, id) {\r\n  var js, fjs = d.getElementsByTagName(s)[0];\r\n  if (d.getElementById(id)) return;\r\n  js = d.createElement(s); js.id = id;\r\n  js.src = \"//connect.facebook.net/en_GB/sdk.js#xfbml=1&version=v2.0\";\r\n  fjs.parentNode.insertBefore(js, fjs);\r\n}(document, \'script\', \'facebook-jssdk\'));</script>','2014-09-10 11:08:07','2014-09-29 15:58:49',NULL,1,-127),(2,'wat','Wat','<div class=\"row\">\r\n        <div>\r\n                <h2>Wat is SIN?</h2>\r\n                <p>SIN staat voor Student Information Network, en is een studentenorganisatie aan Thomas More campus Geel die zich bezighoudt met het aanbieden van web services aan studenten van de hogeschool, en het promoten van <a href=\"https://nl.wikipedia.org/wiki/Open_source\">open source</a> software.</p>\r\n        </div>\r\n        \r\n        <div>\r\n                <h2>Wat bieden wij?</h2>\r\n                <p>SIN biedt verschillende services aan aan zijn leden.</p>\r\n                <ul>\r\n                        <li>\r\n                                <strong>Webhosting</strong><br />\r\n                                SIN-leden krijgen van ons hun eigen webruimte waar zij hun website op kunnen hosten. Deze zal te bereiken zijn via [gebruikersnaam].sinners.be. Indien u zelf al een domein heeft en dit wenst te gebruiken met uw SIN-account kunt u altijd <a href=\"/page/contact\">contact met ons opnemen</a>.<br />\r\n                                Websites en/of bestanden uploaden kan gedaan worden via FTP of SFTP.\r\n                        </li>\r\n                        <li>\r\n                                <strong>Shell-toegang</strong><br />\r\n                                Wij bieden onze leden ook shell-toegang. Via SSH kunnen leden verbinden met sinners.be, waar zij vervolgens begroet worden met hun shell naar keuze (standaard Bash).\r\n                        </li>\r\n                        <li>\r\n                                <strong>E-mail</strong><br />\r\n                                Leden kunne bij ons verschillende e-mailaccounts en doorstuuradressen aanmaken. Wegens herhaaldelijk misbruik zal dit echter actief worden gecontroleerd op misbruik. Het versturen van SPAM-mails via SIN is <em>niet</em> toegestaan!\r\n                        </li>\r\n                        <li>\r\n                                <strong>Databases</strong><br />\r\n                                Bij een dynamische website hoort meestal een database. Ook databases staan tot uwer beschikking.\r\n                        </li>\r\n                        <li>\r\n                                <strong>Cloudopslag</strong><br />\r\n                                Sinds dit schooljara biedt SIN ook cloudopslag aan! Dit is te vergelijken met Dropbox en Google Drive. U kunt uw cloudopslag altijd bereiken via de website, en u kunt er eveneens voor kiezen om uw cloudopslag te laten synchroniseren met uw computer(s).<br />\r\n                                SIN Cloud is te bereiken via <a href=\"https://cloud.sinners.be/\">cloud.sinners.be</a>.\r\n                        </li>\r\n                        <li>\r\n                                <strong>Draait SIN ook [service]?</strong><br />\r\n                                Als je een voorstel hebt <a href=\"/page/contact\">horen we het graag</a>! We staan altijd open voor suggesties!\r\n                        </li>\r\n                </ul>\r\n        </div>\r\n                \r\n        <div>\r\n                <h2>Beperkingen?</h2>\r\n                <p>Over het algemeen maakt SIN gebruik van een <strong>Fair Use Policy</strong>. Dit houdt in dat wij niet moeilijk doen zolang er geen misbruik van gemaakt wordt. Als u 50GB aan cloudopslag gebruikt is dit opzich geen probleem, zolang dit er niet voor zorgt dat er geen schijfruimte meer overblijft voor andere gebruikers. Ook is het niet de bedoeling dat onze services gebruikt worden voor illegale praktijken. Het gebruik van onze services is steeds gebonden aan ons huisregelement.</p>\r\n                <p>In ons control panel (SINControl) staan een aantal beperkingen ingesteld op het aantal FTP-accounts, e-mailadressen, ... die een gebruiker kan hebben. Dit is eveneens om misbruik te voorkomen. Indien u het standaardlimiet bereikt heeft kunt u steeds <a href=\"/page/contact\">contact met ons opnemen</a>. Vergeet niet te vertellen waarom je graag extra FTP-accounts/e-mailadressen/cloudopslag/... zou hebben. Indien de reden niet ingaat tegen ons huisregelement (zoals het verpreiden van illegale inhoud) zal dit normaalgesproken geen probleem zijn en zal uw limiet verhoogd worden.</p>\r\n        </div>\r\n                \r\n        <div>\r\n                <h2>Kostprijs?</h2>\r\n                <p>Een SIN-account kost slechts een symbolische <strong>5 euro per jaar</strong>! Organisaties kunnen bij ons zelfs een <strong>gratis</strong> account <a href=\"/page/contact\">aanvragen</a>!</p>\r\n        </div>\r\n                \r\n        <div>\r\n                <h2>Ik ben overtuigd!</h2>\r\n                <p>Goed! Dan kan je je <a href=\"/user/register\">hier registreren</a>!</p>\r\n                <p><a href=\"/user/register\" class=\"button\">Registreren</a></p>\r\n        </div>\r\n</div>','2014-09-10 11:35:26','2014-09-10 15:25:48',NULL,0,-120),(3,'medewerkers','Medewerkers','<h1>Medewerkers</h1>\r\n<p>SIN heeft door de jaren heen heel wat medewerkers gehad. Dit zijn de mensen die SIN mogelijk hebben gemaakt.</p>\r\n<p>Onze medewerkers zijn opgedeeld in 4 categorieën:</p>\r\n<ul>\r\n        <li>\r\n                <strong>Junior</strong><br />\r\n                Wanneer een medewerker zich meldt bij SIN krijgt deze de naam <em>junior</em>. Een <em>junior</em> is een medewerker die zich nog niet heeft bewezen. Juniors mogen deelnemen aan vergaderingen en zelfs (onder toezicht) werken uitvoeren aan de systemen, maar zij zullen nog geen volledige beheerdersrechten hebben tot de servers.\r\n        </li>\r\n        <li>\r\n                <strong>Staff</strong><br />\r\n                Wanneer een medewerker zichzelf heeft bewezen kan er voor gestemd worden om deze medewerker een volwaardig stafflid te maken. Dit betekent dat de medewerker in kwestie een sleutel van het serverlokaal krijgt en alle <em>root</em>-wachtwoorden krijgt waarmee deze volledige toegang tot alle servers zal hebben.\r\n        </li>\r\n        <li>\r\n                <strong>Senior</strong><br />\r\n                Seniors zijn medewerkers die al een bepaalde tijd stafflid zijn. Dit heeft verder geen enkele betekenis.\r\n        </li>\r\n        <li>\r\n                <strong>Alumni staff</strong><br />\r\n                Als onze medewerkers stoppen met studeren (hopelijk met een diploma in handen) kunnen deze er voor kiezen om (mits goedkeurig) alumni-stafflid te worden. Dat betekent dat deze medewerkers nog een aantal jaren hun beheerdersrechten kunnen houden om de servers nog mee te helpen onderhouden. Alumni staffleden hebben nog beheerdersrechten maar geen bestuursrechten meer.\r\n        </li>\r\n</ul>\r\n\r\n<h2>Huidige medewerkers</h2>\r\n<table>\r\n        <tr>\r\n                <th>Gebruikersnaam</th>\r\n                <th>Naam</th>\r\n                <th>Status</th>\r\n                <th>Functie</th>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>yerlix</kbd></td>\r\n                <td>Yoeri Stessens</td>\r\n                <td>Alumni staff</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>runes</kbd></td>\r\n                <td>Tom Nys</td>\r\n                <td>Alumni staff</td>\r\n                <td>Systeembeheerder</td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>kyron</kbd></td>\r\n                <td>Kyron Vannuffelen</td>\r\n                <td>Alumni staff</td>\r\n                <td>Systeembeheerder</td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>kerky</kbd></td>\r\n                <td>Glenn Kerckhofs</td>\r\n                <td>Senior</td>\r\n                <td>Secretaris<br />Netwerkbeheerder</td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>robinj1995</kbd></td>\r\n                <td>Robin Jacobs</td>\r\n                <td>Staff</td>\r\n                <td>Systeembeheerder<br />Ontwikkelaar SINControl</td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>grottem</kbd></td>\r\n                <td>Stijn Michiels</td>\r\n                <td>Staff</td>\r\n                <td>Netwerkbeheerder</td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>culacant</kbd></td>\r\n                <td>Jonas Daeyaert</td>\r\n                <td>Staff</td>\r\n                <td>Systeembeheerder</td>\r\n        </tr>\r\n        <tr>\r\n                <td></td>\r\n                <td>Maarten Van Lint</td>\r\n                <td></td>\r\n                <td>SIN-coach</td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>on8tom</kbd></td>\r\n                <td>Tom Putzeys</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>jolu</kbd></td>\r\n                <td>Jochem Luytens</td>\r\n                <td>Junior<br />(Inactief)</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>knarf</kbd></td>\r\n                <td>Frank Meeusen</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>jluyckx</kbd></td>\r\n                <td>Jef Luyckx</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>karlos</kbd></td>\r\n                <td>Karlos van Hest</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>jamiev</kbd></td>\r\n                <td>Jamie Vereecken</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>kristof1995</kbd></td>\r\n                <td>Kristof Hendrickx</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>namp007</kbd></td>\r\n                <td>Pieter Vandeperre</td>\r\n                <td>Junior</td>\r\n                <td></td>\r\n        </tr>\r\n</table>\r\n\r\n<h2>Alumni</h2>\r\n<p>Alumni zijn de oud-medewerkers. Deze mensen hebben zich door de jaren heen ingezet voor SIN, en hebben dan ook een levenslange gratis account verdiend samen met een plaatsje op deze lijst.<br />\r\nWij bedanken hen allemaal voor hun bijdrage!</p>\r\n<p class=\"alert-box secondary\">Lijst nog aan te vullen...</p>\r\n<table>\r\n        <tr>\r\n                <th>Gebruikersnaam</th>\r\n                <th>Naam</th>\r\n                <th>Functie</th>\r\n                <th>Periode</th>\r\n        </tr>\r\n        <tr>\r\n                <td><kbd>pedro</kbd></td>\r\n                <td>Peter Vleugels</td>\r\n                <td>Voorzitter</td>\r\n                <td>1997-1998</td>\r\n        </tr>\r\n        <!--//TODO//-->\r\n</table>\r\n\r\n<h2>Medewerker worden?</h2>\r\n<p>Heb je interesse in Linux, systeembeheer of virtualisatie? Voorkennis is altijd mooi meegenomen maar is zeker niet nodig. Als je wil bijleren zal dit zeker en vast lukken!<br />\r\nOok mensen die meer geïnteresseerd zijn in andere zaken zoals PR, design of programmeren zijn welkom bij SIN.</p>\r\n<p><a href=\"/page/contact\" class=\"button\">Contacteer ons!</a></p>\r\n\r\n<h2>Vergaderingen</h2>\r\n<p>Medewerkers worden verwacht regelmatig aanwezig te zijn op vergaderingen. Van de vergaderingen worden ook altijd verslagen gemaakt die (met sommige uitzonderingen) publiek beschikbaar worden gezet op onze website.</p>\r\n<p>\r\n        <a class=\"button\" href=\"https://cloud.sinners.be/public.php?service=files&t=58660441a46c42b001e3eac662e00c40\">Vergaderverslagen</a>\r\n</p>','2014-09-10 11:53:33','2014-09-29 14:41:05',NULL,1,-110),(4,'geschiedenis','Geschiedenis','<h1>Het ontstaan van SIN</h1>\r\n<p><b>Juni - September 2014 :</b></p>\r\n<p>SIN heeft het afgelopen jaar uitzonderlijk slecht gedraaid. De laatste maanden moest er meerdere malen per week een stafflid naar het serverlokaal om één of andere server (meestal Swan) geforceerd af te sluiten en weer op te starten. Er is altijd door de jaren heen verdergebouwd op bestaande systemen. Een <em>quick fix</em> hier, een scriptje daar, tot SIN uiteindelijk enkel nog aan elkaar hing met een rol ducktape bestaande uit een combinatie van Bash, PHP en cron jobs. Er moet iets gebeuren.</p>\r\n<p>Robin (robinj1995) en Kyron komen een aantal keer samen om een plan uit te denken, en beslissen uiteindelijk op virtualisatie. De plannen zijn gemaakt. In de zomervakantie zal SIN vanop de grond opnieuw worden opgebouwd met virtualisatie. Spannend!</p>\r\n<p>Een week lang zullen een groep medewerkers elke dag naar school komen om het nieuwe SIN op te bouwen. Wegens omstandigheden (materiaal dat er niet tijdig was, problemen met de voorzitter, moeilijk-vindbare fouten, ...) is het nieuwe SIN echter verre van klaar tegen het einde van deze week en wordt er besloten Xena en Snap weer aan te sluiten. De nieuwe setup wordt via de <em>stepping stone</em> bereikbaar gemaakt voor de staffleden zodat zij hier in de loop van de zomervakantie aan kunnen verderwerken.</p>\r\n<p>Het is zover. Het academiejaar begint. Het systeem is nog niet perfect, en bevat zelfs nog heel wat kinderziektes, maar SIN draait! Omdat SINControl volledig from scratch herschreven is krijgt onze website ook een nieuw likje verf.</p>\r\n<p>\r\n        <b>Setup</b>\r\n        <table>\r\n                <tr>\r\n                        <th>Server</th>\r\n                        <th>Functie</th>\r\n                        <th>Software</th>\r\n                </tr>\r\n                <tr>\r\n                        <td>Squid</td>\r\n                        <td>Node 1 in virtualisatiecluster</td>\r\n                        <td>Proxmox VE</td>\r\n                </tr>\r\n                <tr>\r\n                        <td>Padawan</td>\r\n                        <td>Node 2 in virtualisatiecluster</td>\r\n                        <td>Proxmox VE</td>\r\n                </tr>\r\n                <tr>\r\n                        <td>Yoda</td>\r\n                        <td>Stepping stone<br />Firewall</td>\r\n                        <td>IPTables</td>\r\n                </tr>\r\n                <tr>\r\n                        <td>Jabba</td>\r\n                        <td>Opslagserver (NAS)</td>\r\n                        <td>NFS</td>\r\n                </tr>\r\n        </table>\r\n        \r\n        <b>Virtual machines & Services</b>\r\n        <ul>\r\n                <li>Web (Apache)</li>\r\n                <li>E-mail (Postfix)</li>\r\n                <li>Database (MariaDB)</li>\r\n                <li>Cloud (ownCloud)</li>\r\n                <li>Shell (OpenSSH)</li>\r\n                <li>DNS (Bind)</li>\r\n                <li>NTP (enkel intern)</li>\r\n        </ul>\r\n</p>\r\n<p><b>Oktober 2013 :</b><br>We verwelkomen de opvolg(st)er van de main-server Squid; Xena! Een oude bekende onder de SIN hostnames. Hell en Heaven zijn terug naar hun oorspronkelijke eigenaar en Swan nam de taak van database-server opnieuw over van Rhea.\r\n<br><br>\r\nHet SIN-kot heeft een make-over gekregen met een vernieuwd 19\" rack en actieve verluchting. Het team is ook flink aan het groeien, met een jonge junior-ploeg en nieuw bestuur. We zijn benieuwd naar wat de toekomst brengt!</p><p><b>December 2010 :</b><br>Deze maand krijgen we te maken met twee stroompannes. Na de eerste, die voor problemen zorgde, treffen we de nodige maatregelen. Voor dit kon gebeuren, was de volgende er reeds - met nefaste gevolgen voor Swan. Rhea doet tijdelijk dienst als database-server, terwijl Heaven, de opvolger voor Swan, klaar staat om (na de examens, uiteraard) in dienst te treden.</p><p><b>Oktober 2010 :</b><br>Hoewel SINcontrol al enkele jaren trouw dienst heeft gedaan, vinden we het tijd voor een update. Er worden plannen gesmeed en UML schema\'s geschetst voor SINcontrol v2. Verder lijkt Swan tekenen van veroudering te vertonen, en is aan een vernieuwing toe.</p><p><b>Augustus 2010 :</b><br>Na veel geknoei wordt er besloten om af te stappen van virtualisatie. Hoewel er veel toekomst in zit, zijn er niet genoeg actieve staffleden die ervaring hebben met de gevirtualizeerde structuur. Een migratie werd gepland en vlot uitgevoerd. SIN zit met het meerendeel van haar services terug op \'Squid\' (die zijn oorspronkelijke naam dus terug erft). SIN\'s serverpark bestaat nu uit Squid (web, shell, mail, files), Swan (db), Bambi (backup) en Targa (staff en games).</p><p><b>December 2009 :</b><br>Er wordt gemigreerd naar een infrastructuur gebaseerd op virtualisatie. Een gebrek aan planning en testing zorgt er voor dat het proces niet van een leien dakje loopt, en de resulterende infrastructuur niet de beoogde voordelen biedt. Op het einde van het academiejaar zijn de planningen voor een volgende migratie, tijdens de zomermaanden, volop aan de gang...</p><p><b>Februari 2009 :</b><br>We hebben weer een migratie achter de rug, waarbij we het gigabit netwerk met jumbo frames opnieuw operationeel maakten en bambi is de volwaardige fileserver geworden (met 1TB bruikbare schijfruimte in raid 5). We maken prometheus klaar voor zijn nieuwe taak als backupserver en alle netwerkkabels zijn mooi gelabeld om het onderhoud in de toekomst te vergemakkelijken.</p><p><b>Oktober 2008 :</b><br>Ondertussen hebben we 7 operationele servers: De gloednieuwe Squid (dual quadcore) voor apache, ssh en ProFTP, Prometheus als fileserver, Swan als database, Xena als xen development platform, Sentinel als onze trouwe gateway, Enigma als de nieuwe standalone mailserver en Bambi die binnenkort de fileserver zal worden.</p><p><b>September 2006 :</b><br>Na lang wachten was het eindelijk zo ver. SIN heeft een eigen lokaal(tje) gekregen voor onze servers. Dit stond al jaren op ons verlanglijstje om downtime te verkomen door grapjassen die de servers in het labo gingen uitschakelen. Het serverpark van SIN is wederom groter geworden. Swan en Durga worden toegevoegd aan de 5 bestaande servers. Swan is even krachtig als Bambi, ons huidige werkpaard, en wordt ingezet om onze SQL database te hosten op haar SCSI schijven. Durga wordt aangesteld als nieuwe backup pc.</p><p><b>September - December 2005 :</b><br>SIN ging op zoek naar nieuwe servers en vond deze. In het totaal staan er nu 5 servers met elk hun eigen functie, database, file, backups, .... Ook werd er een intern gigabit netwerk opgestart en hardeschijven aangekocht om zo een capaciteit van 400 GIG in raid 5 te bekomen.</p><p><b>December 2004 :</b><br>Bambi is volledig klaar, en een grote actie naar de studenten toe geeft ons een totaal leden aantal van rond de 200 leden, een groot succes, het grootste leden aantal sinds jaren.</p><p><b>Oktober 2004 :</b><br>Onze nieuwe server, welke Bambi gedoopt is, is aangekomen op de khk. Het team begint direct met de installatie van het nieuwe paradepaardje van SIN. En een week later is deze server up and running en bieden de eerste leden zich aan.</p><p><b>September 2004 :</b><br>De nieuwe server wordt besteld, het is een Dell Poweredge 1600SC geworden.</p><p><b>Augustus 2004 :</b><br>De walhalla server heeft de geest gegeven op augustus. Alles was verbrand binnen in, moederbord, CPU, voeding en harde schijven met natuurlijk bijbehorende dataverlies.\r\nEr wordt direct gezocht naar geld voor een nieuwe server, Sovo (nu Stuvo) wordt gecontacteerd en zij zijn bereid het geld hiervoor ter onze beschikking te stellen. Het team gaat naarstig op zoek naar een nieuwe server.</p><p><b>Mei 2004 :</b><br>Er gebeurden opmerkelijk veel crashes en de server \"asgard\" deed heel raar. De oorzaak bleek een kapot moederbord te zijn. Geen probleem, de belangrijkste services zoals DNS draaiden verder op de oudste server \"walhalla\".</p><p><b>Januari 1998 :</b><br>Op een koude woensdagvoormiddag trekken Pedro en Rib hun stoute schoenen aan en duiken samen met Frank Rommes in de catacomben van de KHK. Enkele uren worden vloeren opgebroken, plafonds verwijderd, kabels getrokken,... Maar na een halve dag zwoegen is het zover: walhalla (zo is de server gedoopt) had een netwerkverbinding!\r\nDe partiele examens leggen alles 2 weken stil. Maar geen nood, de dagen na de partieels wordt er hard gewerkt zodat de server klaar is voor het grote werk. SIN is operationeel, 2 maanden voor de stoutste verwachtingen !-)</p><p><b>December 1997 :</b><br>De server wordt geleverd en direct afgevoerd naar Rib\'s thuis. De KHK is immers tijdens de vakantie gesloten. Na een week installeren, configureren, opnieuw installeren, opnieuw configuren,... verhuist de server naar zijn vaste stek op de KHK. Het is nu alleen nog wachten op de netwerkverbinding...</p><p><b>November 1997 :</b><br>Na wat gelobby bij docenten en directie wordt de eerste officiele vergadering belegd met de mensen van den A-blok. De uitkomst van de vergadering overtreft de stoutste dromen! Niet alleen was de vereniging goedgekeud. Er zijn ook weinig beperkingen opgelegd en de KHK zou de verening voor een groot stuk financieren. Een week later wordt de al server gekocht! Alles komt in een stroomversnelling terecht.</p><p><b>Oktober 1997 :</b><br>Vier zotte zielen (rib, pedro, abraham en dot) vinden elkaar en slaan de handen in elkaar. Ze zouden proberen om in een Geel een studentenvereniging op te richten die de drempel tot computers in het algemeen en het Internet in het bijzonder wil verlagen. Inspiratie werd gezocht bij <a href=\"http://www.ulyssis.org/\">ULYSSIS</a> in Leuven.\r\nEr worden doelstellingen geschreven, begrotingen ontworpen, KHK-battle-plans opgesteld,... en er wordt na lang twijfelen gekozen voor de mooie naam Student Information Networking. De toen opgestelde agenda voorzag dat SIN eind februari operationeel zou zijn, in het beste geval!!</p><p><b>Augustus - September 1997 :</b><br>Enkele duistere internetters uit de Kempen wisselen al lachend ideen uit over een nieuwe studentenvereniging aan de Katholieke Hogeschool Kempen. Het bleef toen bij dromen...</p>\r\n<p>Fouten? <a href=\"/page/contact\">Contacteer ons</a>!</p>\r\n','2014-09-10 11:56:55','2014-09-25 16:19:09',NULL,1,-100),(5,'contact','Contact','<div class=\"row\">\r\n        <h1>Contact</h1>\r\n        <p>Lukt er iets niet? Heb je een vraag? Suggesties/opmerkingen? Contacteer ons gerust!</p>\r\n\r\n        <div class=\"row\">\r\n                <div class=\"large-6 medium-6 small-12 column\">\r\n                        <h2>E-mail</h2>\r\n                        <p>De eenvoudigste manier om ons te contacteren is waarschijnlijk via e-mail. Dit kan u doen op het volgende e-mailadres: s<span class=\"weDontLikeSpamBots\">_</span>i<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>@<span class=\"weDontLikeSpamBots\">_</span>s<span class=\"weDontLikeSpamBots\">_</span>i<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>e<span class=\"weDontLikeSpamBots\">_</span>r<span class=\"weDontLikeSpamBots\">_</span>s<span class=\"weDontLikeSpamBots\">_</span>.<span class=\"weDontLikeSpamBots\">_</span>b<span class=\"weDontLikeSpamBots\">_</span>e</p>\r\n                        <p>Let op: Als de servers niet werken heeft e-mails sturen geen zin. Als de servers niet werken komen e-mails niet aan en gaan deze waarschijnlijk verloren. In deze gevallen is het waarschijnlijk beter om ons op een andere manier te contacteren.</p>\r\n                        <p>Indien u zeker wil zijn dat u ons kan bereiken (via e-mail) kan u ook altijd mailen naar s<span class=\"weDontLikeSpamBots\">_</span>i<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>e<span class=\"weDontLikeSpamBots\">_</span>r<span class=\"weDontLikeSpamBots\">_</span>s<span class=\"weDontLikeSpamBots\">_</span>s<span class=\"weDontLikeSpamBots\">_</span>t<span class=\"weDontLikeSpamBots\">_</span>a<span class=\"weDontLikeSpamBots\">_</span>f<span class=\"weDontLikeSpamBots\">_</span>f<span class=\"weDontLikeSpamBots\">_</span>@<span class=\"weDontLikeSpamBots\">_</span>g<span class=\"weDontLikeSpamBots\">_</span>m<span class=\"weDontLikeSpamBots\">_</span>a<span class=\"weDontLikeSpamBots\">_</span>i<span class=\"weDontLikeSpamBots\">_</span>l<span class=\"weDontLikeSpamBots\">_</span>.<span class=\"weDontLikeSpamBots\">_</span>c<span class=\"weDontLikeSpamBots\">_</span>o<span class=\"weDontLikeSpamBots\">_</span>m</p>\r\n                        <p class=\"alert-box secondary\">Aangezien wij al enige tijd zijn overgeschakeld op ons nieuwe domein en ook wij niet zo gek zijn van spambots zal ons oude e-mailadres (s<span class=\"weDontLikeSpamBots\">_</span>i<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>@<span class=\"weDontLikeSpamBots\">_</span>s<span class=\"weDontLikeSpamBots\">_</span>i<span class=\"weDontLikeSpamBots\">_</span>n<span class=\"weDontLikeSpamBots\">_</span>.<span class=\"weDontLikeSpamBots\">_</span>k<span class=\"weDontLikeSpamBots\">_</span>h<span class=\"weDontLikeSpamBots\">_</span>k<span class=\"weDontLikeSpamBots\">_</span>.<span class=\"weDontLikeSpamBots\">_</span>b<span class=\"weDontLikeSpamBots\">_</span>e) niet langer worden gebruikt.\r\n                </div>\r\n                \r\n                <div class=\"large-6 medium-6 small-12 column\">\r\n                        <h2>Facebook</h2>\r\n                        <p>U kunt ook ons steeds contacteren via <a href=\"https://www.facebook.com/SINners.be\">onze Facebook-pagina</a>. Dit kan u doen door een bericht op onze <em>tijdlijn</em> te zetten of door ons een privébericht te sturen. Eén van onze medewerkers zal vervolgens uw bericht zo snel mogelijk beantwoorden.<br />\r\n                        Tip: Op deze pagina zult u ook regelmatig updates vinden over geplande werkzaamheden en dergelijke.</p>\r\n                </div>\r\n                \r\n                <div class=\"large-6 medium-6 small-12 column\">\r\n                        <h2>IRC</h2>\r\n                        <p>Voor zij die het kennen; U kunt SIN ook vinden op <kbd>irssi.be.krey.net</kbd> in <kbd>#sin</kbd>. Hier vindt u eveneens ook veel van onze oud-medewerkers terug.<br />\r\n                        Zoals in elk IRC channel geldt de regel; <em>\"Idling is not a crime!\"</em><br />\r\n                        Wees geduldig.</p>\r\n                        <p>U kunt ook gebruik maken van de web IRC-client.</p>\r\n                        <p><a href=\"/page/irc\" class=\"button\">Ga naar #SIN</a></p>\r\n                </div>\r\n        </div>\r\n</div>','2014-09-10 12:08:51','2014-09-17 06:25:04',NULL,1,50),(6,'irc','IRC','<div class=\"row\">\r\n        <iframe src=\"https://kiwiirc.com/client/irssi.be.krey.net/#sin\" style=\"border:0; width:100%; height:450px;\"></iframe>\r\n</div>','2014-09-17 06:20:16','2014-09-17 06:23:39',NULL,0,0);
